// import { Login } from "./Login"
// import { Products } from "./Products"
// import { Register } from "./Register"
// import { CreditCard } from "../../myProject/CreditCard"

export const Routing = () => {

    return <>
        <Routes>
            <Route path="homePage" element={<HomePage></HomePage>}></Route>
